import React from 'react';
import { motion } from 'framer-motion';

export default function AnimeImages() {
    return (
        <>
            {/* Menu */}
            <motion.nav
                style={{
                    height: '60px',
                    backgroundColor: '#222',
                    color: '#fff',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                }}
                initial={{ y: -100 }}
                animate={{ y: 0 }}
                transition={{ duration: 1, ease: 'easeOut' }}
            >
                <ul
                    style={{
                        display: 'flex',
                        listStyleType: 'none',
                        padding: 0,
                        margin: 0,
                    }}
                >
                    <motion.li
                        whileHover={{ scale: 1.2, color: '#FFD700' }}
                        style={{
                            margin: '0 20px',
                            cursor: 'pointer',
                        }}
                    >
                        <a
                            href="#home"
                            style={{
                                textDecoration: 'none',
                                color: '#fff',
                                fontSize: '18px',
                            }}
                        >
                            Home
                        </a>
                    </motion.li>
                    <motion.li
                        whileHover={{ scale: 1.2, color: '#FFD700' }}
                        style={{
                            margin: '0 20px',
                            cursor: 'pointer',
                        }}
                    >
                        <a
                            href="#gallery"
                            style={{
                                textDecoration: 'none',
                                color: '#fff',
                                fontSize: '18px',
                            }}
                        >
                            Gallery
                        </a>
                    </motion.li>
                    <motion.li
                        whileHover={{ scale: 1.2, color: '#FFD700' }}
                        style={{
                            margin: '0 20px',
                            cursor: 'pointer',
                        }}
                    >
                        <a
                            href="#contact"
                            style={{
                                textDecoration: 'none',
                                color: '#fff',
                                fontSize: '18px',
                            }}
                        >
                            Contact
                        </a>
                    </motion.li>
                </ul>
            </motion.nav>

            {/* Section principale */}
            <motion.div
                id="gallery"
                style={{
                    display: 'flex',
                    justifyContent: 'space-around',
                    alignItems: 'center',
                    height: '80vh',
                    backgroundColor: '#000000',
                }}
            >
                {/* Premier conteneur */}
                <motion.div
                    initial={{ y: 200 }}
                    animate={{ y: 0 }}
                    transition={{
                        duration: 1.5,
                        ease: 'easeInOut',
                    }}
                    style={{
                        width: '200px',
                        height: '300px',
                        backgroundColor: '#ffffff',
                        borderRadius: '15px',
                        overflow: 'hidden',
                        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                    }}
                >
                    <img
                        src="https://images6.alphacoders.com/135/1352218.png" // Image de Luffy
                        alt="Luffy"
                        style={{
                            width: '100%',
                            height: '100%',
                            objectFit: 'cover',
                        }}
                    />
                </motion.div>

                {/* Deuxième conteneur */}
                <motion.div
                    initial={{ y: 200 }}
                    animate={{ y: 0 }}
                    transition={{
                        duration: 1.5,
                        ease: 'easeInOut',
                        delay: 0.3,
                    }}
                    style={{
                        width: '200px',
                        height: '300px',
                        backgroundColor: '#ffffff',
                        borderRadius: '15px',
                        overflow: 'hidden',
                        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                    }}
                >
                    <img
                        src="https://images2.alphacoders.com/136/1369365.jpeg" // Image de Zoro
                        alt="Zoro"
                        style={{
                            width: '100%',
                            height: '100%',
                            objectFit: 'cover',
                        }}
                    />
                </motion.div>
            </motion.div>

            {/* Footer */}
            <motion.footer
                id="contact"
                style={{
                    height: '60px',
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    backgroundColor: '#222',
                    color: '#fff',
                    fontSize: '16px',
                    boxShadow: '0 -4px 10px rgba(0, 0, 0, 0.2)',
                }}
                initial={{ y: 100 }}
                animate={{ y: 0 }}
                transition={{ duration: 1, ease: 'easeOut' }}
            >
                © 2024 Anime Gallery - Tous droits réservés
            </motion.footer>
        </>
    );
}
